/*이미지경로*/
$url:"img/";


@mixin property {
  transition-property: all;
  -webkit-transition-property: all;  
  -o-transition-property: all;
  transition-duration: 0.5s;
  -webkit-transition-duration: 0.5s;
  -o-transition-duration: 0.5s;
  @content;
}


/*반응형 스위치*/
.view-m{ display:none; }


/*여기부터 코딩스타트!*/
.container-main{
  padding:0; margin:0;
  background-color:$main-color;
  .header{
    position:fixed;
    top:0;
    width:100%;
    padding: 22px 0;
    z-index:100;
    @include property;
    .head-container{
      width:100%;
      .head-main{
        width:100px;
        padding:0 10px;
        text-align: center;
        position:relative;
        .main-logo{
          width:calc(100px - 20px);
        }
      }
    }
    .customer.customerOpen{
      z-index: -1;
      opacity: 1;
      height:100vh;
      width:100vw;
      top:0;
      left:0;
      background:$main-color;
      padding:0 100px;
      position:absolute;
      display:flex;
      transform:translate(0, 0%);
      -webkit-transform:translate(0, 0%);
      -o-transform:translate(0, 0%);
      -ms-transform:translate(0, 0%);
      visibility : visible;
      transition: all 0.3s;
    }
    .customer{
      z-index: -1;
      opacity: 1;
      height:100vh;
      width:100vw;
      top:0;
      left:0;
      background:$main-color;
      transition: all 0.3s;
      padding:0 100px;
      position:absolute;
      display:flex;
      transform:translate(0, -100%);
      -webkit-transform:translate(0, -100%);
      -o-transform:translate(0, -100%);
      -ms-transform:translate(0, -100%);
      visibility : visible;
      
      .customer-cover{
        position:absolute;
        top: 50%;
        left: 0px;
        font-size:10vw;
        font-weight:600;
        line-height:1.15;
        transform:translateY(-50%);
        -webkit-transform:translateY(-50%);
        -ms-transform:translateY(-50%);
        opacity: 0.05;
      }
      .customer-container{
        padding:0 50px;
        border-left:1px solid $border-color;
        border-right:1px solid $border-color;
        width:100%;
        max-width:100%;
        position:relative;
        display: flex;
        justify-content: center;
        flex-direction: column;
        height:100vh;
        .customer-menu{
          width:100%;
          padding:20px 0;
          .customer-menu-title{
